import React, { useEffect, useState } from "react";
import axios from "axios";

// Define the type for the car object
interface Car {
  _id: string;
  brand: string;
  model: string;
  seats: number;
  category: string;
  horsepower: number;
  seatsCount: number;
  fuelType: string;
  price: number;
  link: string;
}

const RestExample = () => {
  const url = 'https://eu-central-1.aws.data.mongodb-api.com/app/car-brmdzib/endpoint/cars';
  const [cars, setCars] = useState<Car[]>([]); // Specify the type for cars

  useEffect(() => {
    axios.get(url).then(res => {
      // Transform the received data into car objects
      const mappedCars: Car[] = res.data.map((car: any) => ({
        _id: car._id,
        brand: car.brand,
        model: car.model,
        seats: car.seats,
        category: car.category,
        horsepower: car.horsepower,
        seatsCount: car.seatsCount,
        fuelType: car.fuelType,
        price: car.price,
        link: car.link
      }));
      setCars(mappedCars);
    });
  }, []);

  return (
    <div className="App">
      <h1>List of Cars</h1>
      <div>
        {/* Render each car */}
        {cars.map(car => (
          <div key={car._id}>
            <p>{`${car.brand} ${car.model}`}</p>
            <p>{`Category: ${car.category}`}</p>
            <p>{`Seats: ${car.seats}`}</p>
            <p>{`Horsepower: ${car.horsepower}`}</p>
            <p>{`Price: ${car.price}`}</p>
            <img src={car.link} alt={`${car.brand} ${car.model}`} style={{ maxWidth: '200px' }} />
          </div>
        ))}
      </div>
    </div>
  );
};

export default RestExample;
